The sum of bad debt expenses for both primary and non-primary production activities.  An individual taxpayer can claim a deduction for:

 - partial debt write-offs; where only part of a debt is bad and is written off, individual taxpayer can may claim a deduction for the amount written off
 - losses incurred in debt-for-equity swaps for debt written off;

Indicate the type of business activity carried out in which a net loss was made. Business loss activity descriptions are; 
161 - Partnership; 
006 - Sole Trader.
